import { useEffect, useState } from "react";
import ApiFunctions from "../ApiFunctions";
import Header from "./Header";
import Footer from "./Footer";
import useToken from "./admin/useToken";
import { useHistory } from "react-router";
import { Helmet } from "react-helmet";



const Appointments = () => {

    const history = useHistory();
    const token = useToken();


    if (!token.token) {
        history.push('/');
    }

    const [list, setList] = useState([]);
    useEffect(() => {
        ApiFunctions.myAppointment(null,{
               headers:{
                'Authorization': token.token.token,
               }
        }).then(res => {
            var data = res.data.data;
            setList(data)
        })
    }, []);

   console.log(list);
   
    return (
        <div className="">
            <Header />
            <Helmet>
				<link rel="stylesheet" href={require('../css/style.css').default} />
			</Helmet>


            <section class="home_1 ap_img1">
            <div class="container">
                <div class="heading">
                    <h1>Appointments</h1>
                </div>
            </div>
        </section>
    <section class="patient_detail">
        <div class="container">
            
            <div class="heading">
                <h2>Appointments</h2>
            </div>
            <div class="patient_table">
                <table>
                    <tbody>
                        <tr class="appointment_history">
                            <td class="productname_td">S.No.</td>
                            <td class="productsize_td">Patient</td>
                            <td class="sellingprice_td">Email</td>
                            <td class="sellingprice_td">Contact</td>
                            <td class="quantity_td">Status</td>
                            <td class="subtotal_td">Appointment DateTime </td>
                            <td class="subtotal_td">Action</td>
                        </tr>

                        <tr class="appointment_history">
                            <td class="productname_td">1</td>
                            <td class="productsize_td">John Thomas</td>
                            <td class="productsize_td">john@gmail.com</td>
                            <td class="sellingprice_td">(07) 4005 5532</td>
                            <td class="quantity_td">Pending</td>
                            <td class="subtotal_td">20 Nov,2022</td>
                            <td class="subtotal_td">
                               <a href=""> Approve</a>
                               <a href=""> Reject</a>
                            </td>
                        </tr>

                        <tr class="appointment_history">
                            <td class="productname_td">1</td>
                            <td class="productsize_td">Jackson</td>
                            <td class="productsize_td">jackson@gmail.com</td>
                            <td class="sellingprice_td">(07) 4005 7845</td>
                            <td class="quantity_td">Pending</td>
                            <td class="subtotal_td">20 Nov,2022</td>
                            <td class="subtotal_td">
                               <a href=""> Approve</a>
                               <a href=""> Reject</a>
                            </td>
                        </tr>
                        
                    </tbody>
                </table>
            </div>
        </div>
    </section>

    <Footer />
               
        </div>
    );
}

export default Appointments;
